import React, { useState, useEffect } from 'react';
import './App.css';
import axios from 'axios';


/*
npm install axios

npm install react-bootstrap bootstrap
*/

function App() {
  const [bids, setBids] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/getBids')
      .then(response => {
        console.log("response: ", response.data);
        console.log("elem: ", response.data[0].Price);
        setBids(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>

    <div>
      <form>
      <label>
      Name:
      <input type="text" name="name" />
      </label>
      <input type="submit" value="Submit" />
      </form>
    </div>

    <div class="container">
    <table>
      <tr>
        <th>Bidder</th> <th>Price</th>
      </tr>
      {bids.map(bid => (
        <tr>
          <th>{bid.Name}</th> <th>{bid.Price}</th>
        </tr>

      ))}
    </table>
    </div>

    </div>
  );
}

export default App;
